-- ----------------------------
--  Table structure for `sys_menu`
-- ----------------------------
DROP TABLE IF EXISTS `sys_menu`;
CREATE TABLE `sys_menu` (
  `id` varchar(32) COLLATE utf8mb4_general_ci NOT NULL COMMENT '编号',
  `parent_id` varchar(32) COLLATE utf8mb4_general_ci NOT NULL COMMENT '父级编号',
  `parent_ids` varchar(2000) COLLATE utf8mb4_general_ci NOT NULL COMMENT '所有父级编号',
  `name` varchar(50) COLLATE utf8mb4_general_ci NOT NULL COMMENT '名称',
  `sort` int(10) NOT NULL COMMENT '排序',
  `href` varchar(200) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '链接',
  `target` varchar(10) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '目标',
  `type` varchar(2) COLLATE utf8mb4_general_ci NOT NULL COMMENT '0：目录   1：菜单   2：按钮',
  `icon` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '图标',
  `is_show` char(1) COLLATE utf8mb4_general_ci NOT NULL COMMENT '是否在菜单中显示',
  `permission` varchar(200) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '权限标识',
  `create_by` varchar(32) COLLATE utf8mb4_general_ci NOT NULL COMMENT '创建者',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(32) COLLATE utf8mb4_general_ci NOT NULL COMMENT '更新者',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `remarks` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注信息',
  PRIMARY KEY (`id`),
  KEY `parent_id` (`parent_id`),
  KEY `parent_ids` (`parent_ids`(191)),
  KEY `name` (`name`),
  KEY `create_by` (`create_by`),
  KEY `create_date` (`create_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=COMPACT COMMENT='菜单';

-- ----------------------------
--  Records of `sys_menu`
