DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `id` varchar(32) COLLATE utf8mb4_general_ci NOT NULL COMMENT '编号',
  `dept_id` varchar(32) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '部门',
  `login_name` varchar(50) COLLATE utf8mb4_general_ci NOT NULL COMMENT '登录名',
  `password` varchar(100) COLLATE utf8mb4_general_ci NOT NULL COMMENT '密码',
  `salt` varchar(20) COLLATE utf8mb4_general_ci NOT NULL,
  `name` varchar(50) COLLATE utf8mb4_general_ci NOT NULL COMMENT '姓名',
  `mobile` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '手机',
  `photo` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '用户头像',
  `email` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '邮件',
  `user_type` varchar(2) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '用户类型，业务扩展用',
  `status` varchar(1) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '状态1：正常，0：禁用',
